"use strict";exports.id=379,exports.ids=[379],exports.modules={7676:(e,t,r)=>{r.d(t,{M4:()=>deleteTicket,Ox:()=>generateId,SP:()=>getTickets,Tw:()=>saveTicket,X$:()=>getTicketStats,mV:()=>getKnowledgeArticles,vk:()=>initializeDefaultData});let o="gday-support-tickets",s="gday-support-knowledge",i={getItem:e=>{try{return localStorage.getItem(e)}catch(e){return console.error("Failed to get item from localStorage:",e),null}},setItem:(e,t)=>{try{return localStorage.setItem(e,t),!0}catch(e){return console.error("Failed to set item in localStorage:",e),!1}}},generateId=()=>Date.now().toString(36)+Math.random().toString(36).substr(2),getTickets=()=>{let e=i.getItem(o);if(!e)return[];try{return JSON.parse(e)}catch(e){return console.error("Failed to parse tickets data:",e),[]}},saveTicket=e=>{let t=getTickets(),r=t.findIndex(t=>t.id===e.id);return r>=0?t[r]={...e,updatedDate:new Date().toISOString()}:t.push(e),i.setItem(o,JSON.stringify(t))},deleteTicket=e=>{let t=getTickets(),r=t.filter(t=>t.id!==e);return i.setItem(o,JSON.stringify(r))},getKnowledgeArticles=()=>{let e=i.getItem(s);if(!e)return getDefaultKnowledgeArticles();try{return JSON.parse(e)}catch(e){return console.error("Failed to parse knowledge articles data:",e),getDefaultKnowledgeArticles()}},getDefaultKnowledgeArticles=()=>[{id:"faq-1",title:"How do I report a bug effectively?",content:'To report a bug effectively: 1) Choose "Bug Report" category, 2) Include steps to reproduce the issue, 3) Describe expected vs actual behavior, 4) Mention which AI tool is affected, 5) Include screenshots if possible. The more details you provide, the faster we can resolve the issue.',category:"Bug Report",tags:["bug-report","troubleshooting","reporting"],createdDate:"2024-01-01T00:00:00Z"},{id:"faq-2",title:"What makes a good feature request?",content:'A good feature request includes: 1) Clear problem statement, 2) Specific use case or user story, 3) Expected benefits, 4) Suggested implementation (if you have ideas), 5) Priority level and business justification. Focus on the "why" not just the "what".',category:"Feature Request",tags:["feature-request","guidelines","best-practices"],createdDate:"2024-01-01T00:00:00Z"},{id:"faq-3",title:"Common AI tool troubleshooting steps",content:"Before reporting a bug, try these steps: 1) Refresh your browser/restart the application, 2) Check internet connection, 3) Clear browser cache and cookies, 4) Try a different browser, 5) Check if the issue happens with different AI tools. If problems persist, report a bug with these steps documented.",category:"Bug Report",tags:["troubleshooting","technical","self-help"],createdDate:"2024-01-01T00:00:00Z"},{id:"faq-4",title:"How long does bug resolution take?",content:"Bug resolution timelines vary by severity: Critical bugs (system down) - 4 hours, High priority bugs - 1-2 days, Medium priority bugs - 1 week, Low priority bugs - 2-4 weeks. You'll receive updates on progress and be notified when the bug is resolved.",category:"Bug Report",tags:["timeline","resolution","priority"],createdDate:"2024-01-01T00:00:00Z"},{id:"faq-5",title:"How are feature requests prioritized?",content:"Feature requests are prioritized based on: 1) Number of users who would benefit, 2) Business impact and ROI, 3) Technical complexity, 4) Alignment with product roadmap. Community voting and feedback also influence prioritization decisions.",category:"Feature Request",tags:["prioritization","process","roadmap"],createdDate:"2024-01-01T00:00:00Z"}],getTicketStats=()=>{let e=getTickets();return{total:e.length,open:e.filter(e=>"Open"===e.status).length,inProgress:e.filter(e=>"In Progress"===e.status).length,closed:e.filter(e=>"Closed"===e.status).length,highPriority:e.filter(e=>"High"===e.priority).length}},getDefaultTickets=()=>[{id:"example-1",title:"ChatGPT returns error when generating long responses",description:'When requesting ChatGPT to generate responses longer than 2000 characters, it returns a "Request timeout" error. This happens consistently across different prompts.\n\nSteps to reproduce:\n1. Open ChatGPT interface\n2. Request a long response (e.g., "Write a 3000-word essay about AI")\n3. Error appears after 30 seconds\n\nExpected: Long response should be generated successfully\nActual: Timeout error is shown',priority:"High",category:"Bug Report",status:"Open",email:"sarah.johnson@discoveryparks.com.au",createdDate:"2024-12-13T10:30:00Z"},{id:"example-2",title:"Add dark mode toggle to AI tools interface",description:"Many team members work in low-light environments and would benefit from a dark mode option for all AI tools. This would reduce eye strain and improve user experience.\n\nBenefits:\n• Reduced eye strain during long work sessions\n• Better battery life on laptops\n• Improved accessibility for users with light sensitivity\n• Modern, professional appearance\n\nSuggested implementation: Toggle switch in the top navigation bar that persists across sessions.",priority:"Medium",category:"Feature Request",status:"In Progress",email:"mike.chen@discoveryparks.com.au",createdDate:"2024-12-12T14:15:00Z"},{id:"example-3",title:"GitHub Copilot suggestions not appearing in VS Code",description:'GitHub Copilot is not showing any code suggestions in VS Code, even though the extension is installed and I have active access.\n\nTroubleshooting attempted:\n• Restarted VS Code\n• Disabled and re-enabled the extension\n• Checked internet connection\n• Verified account permissions\n\nThe status bar shows "Copilot: Ready" but no suggestions appear while typing.',priority:"High",category:"Bug Report",status:"Closed",email:"alex.rodriguez@discoveryparks.com.au",createdDate:"2024-12-11T09:45:00Z"},{id:"example-4",title:"Bulk export feature for AI tool usage reports",description:"As a team manager, I need the ability to export usage reports for all AI tools in bulk for compliance and budgeting purposes.\n\nCurrent limitation: Reports must be exported individually for each tool\nDesired feature: Single export button that generates a comprehensive report\n\nUse case: Monthly reporting to leadership about AI tool adoption and ROI\nFormat preference: CSV or Excel with separate sheets for each tool",priority:"Low",category:"Feature Request",status:"Open",email:"jennifer.wong@discoveryparks.com.au",createdDate:"2024-12-10T16:20:00Z"},{id:"example-5",title:"Midjourney images fail to load in shared workspace",description:'When multiple users try to access Midjourney-generated images in our shared workspace, images fail to load with a "403 Forbidden" error.\n\nError details:\n• Occurs only in shared workspace, not personal workspaces\n• Affects all image formats (PNG, JPG, WEBP)\n• Browser console shows CORS policy error\n• Images load fine when accessed directly from Midjourney\n\nImpact: Team cannot collaborate on visual projects effectively',priority:"Medium",category:"Bug Report",status:"In Progress",email:"david.taylor@discoveryparks.com.au",createdDate:"2024-12-09T11:30:00Z"}],initializeDefaultData=()=>{if(!i.getItem(s)){let e=getDefaultKnowledgeArticles();i.setItem(s,JSON.stringify(e))}if(!i.getItem(o)){let e=getDefaultTickets();i.setItem(o,JSON.stringify(e))}}}};